import React from 'react';

import { Navbar, Nav, Container } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap';

const Header = () => {
  return (
    <header>
      <Navbar>
        <Nav>Home</Nav>
        <Nav>Home</Nav>
        <Nav>Home</Nav>
      </Navbar>
    </header>
  );
};

export default Header;
